import React from 'react';
import '../css/home.css'
import axios from 'axios';
import { toast } from 'react-toastify';
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';
function Home(props) {
    const navigate = useNavigate()
    
    const [randomNumber, setRandomNumber] = useState(null);

    const generateRandomNumber = () => {
        const min = 1;
        const max = 250;
        const newRandomNumber = Math.floor(Math.random() * (max - min + 1)) + min;
        setRandomNumber(newRandomNumber);
    }

    const user = {
        "deviceId": "42940546-D218-4ABF-958B-FB87AE0FC10A",
        "reason": "",
        "ssid": "FIS-user",
        "ipGateway": "10.15.180." + randomNumber  ,
        "type": 0
    }
    
    const check_in = async () => {
        var getToken = localStorage.getItem("token")
        const res = await axios.post('https://ddc.fis.vn/fis0/api/checkin_all', { headers: { "Authorization": `Bearer ${getToken}` } })
        if (res.data.resultCode == -1) {
            toast.warning(res.data.message)
            navigate('/')
        }
        else (
            toast.success(res.data.message)
        )
    }

    const check_out = async () => {
        var getToken = localStorage.getItem("token")
        const res = await axios.post('https://ddc.fis.vn/fis0/api/checkout_all',user, { headers: { "Authorization": `Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxMTNhMzgxMzg0NGQxMjFjNzZiMjdjNSIsInVzZXJuYW1lIjoibHVvbmd0djEwIiwiaWF0IjoxNzEwNzU4MDcwLCJleHAiOjE3MTEwMTcyNzB9.V8spgecAHFdiSp45koHMiyk3Dql5T75ory6kqUXJOjU`} })
        if (res.data.resultCode == -1) {
            toast.warning(res.data.message)
            navigate('/')
        }
        else (
            toast.success(res.data.message)
        )
    }
    return (
        <div className='box-check'>
            <div className='d-flex justify-content-between '>
                <button type="button" class="btn btn-info text-white" onClick={() => check_in()}>Chi</button>
                <button type="button" class="btn btn-danger text-white" onClick={() => check_out()}>Chot</button>
            </div>
        </div>
    );
}

export default Home;
